import os, pickle
from collections import OrderedDict

import nose.tools as n
n.assert_list_equal.__self__.maxDiff = None

from ..download import _post_args

with open(os.path.join('scarsdale_property_inquiry', 'test', 'fixtures', 'home.p'), 'rb') as fp:
    _, home = pickle.load(fp)

def test_post_street():
    observed_args, observed_kwargs = _post_args('street', 'the street id', home,
                                                user_agent = 'a browser')

    expected_args = ('http://www.scarsdale.com/Home/Departments/InformationTechnology/PropertyInquiry.aspx', )
    expected_kwargs = {
        'headers': [
            ('Accept-Language', 'en-US,en;q=0.5'),
            ('Referer', 'http://www.scarsdale.com/Home/Departments/InformationTechnology/PropertyInquiry.aspx'),
            ('Accept-Encoding', 'gzip,deflate,sdch'),
            ('User-Agent', 'a browser'),
            ('Accept', 'text/html,application/xhtml+xml,application/xml;q=0.9,*/*;q=0.8'),
            ('Cookie', '.ASPXANONYMOUS=9WEEbBUJ0AEkAAAAMmU1NWFkYzItMTQ3OC00ZTZkLWE3NzMtNGE5NTgyZWZmYjE10; 51D=3155378975999999999; ASP.NET_SessionId=shycdfv2hq2tvbrkzcgxkuzm; language=en-US'),
            ('Connection', 'keep-alive'),
            ('Content-Encoding', 'gzip'),
            ('Host', 'www.scarsdale.com'),
            ('Origin', 'http://www.scarsdale.com'),
        ],
        'files': [
            ('StylesheetManager_TSSM', ('', '')),
            ('ScriptManager_TSM', ('', ';;System.Web.Extensions, Version=3.5.0.0, Culture=neutral, PublicKeyToken=/Telerik.Web.UI.WebResource.axd?_TSM_HiddenField_=ScriptManager_TSM&compress=1&_TSM_CombinedScripts_=;;System.Web.Extensions,+Version=3.5.0.0,+Culture=neutral,+PublicKeyToken=31bf3856ad364e35:en-US:eb198dbd-2212-44f6-bb15-882bde414f00:ea597d4b:b25378d2')),
            ('__EVENTTARGET', ('', 'dnn$ctr1398$ViewHelloWorld$lstboxStreets')),
            ('__EVENTARGUMENT', ('', '')),
            ('__LASTFOCUS', ('', '')),
            ('__VIEWSTATE', ('', '')),
            ('__VIEWSTATEGENERATOR', ('', 'CA0B0334')),
             ('__EVENTVALIDATION', ('', '')),
            ('dnn$SEARCH1$Search', ('', 'SiteRadioButton')),
            ('dnn$SEARCH1$txtSearch', ('', '')),
            ('dnn$ctr1398$ViewHelloWorld$lstboxStreets', ('', 'the street id')),
            ('dnn$ctr1398$ViewHelloWorld$txtProperty', ('', '')),
            ('dnn$dnnSEARCH$Search', ('', 'SiteRadioButton')),
            ('dnn$dnnSEARCH$txtSearch', ('', '')),
            ('ScrollTop', ('', '228')),
            ('__dnnVariable', ('', '`{`__scdoff`:`1`}')),
        ],
    }
    n.assert_tuple_equal(observed_args, expected_args)
    n.assert_set_equal(set(observed_kwargs.keys()), {'headers', 'files'})
    n.assert_dict_equal(dict(observed_kwargs['files']), dict(expected_kwargs['files']))
    n.assert_dict_equal(observed_kwargs['headers'], dict(expected_kwargs['headers']))

